import React, { useState } from 'react';
import { View, Text, Switch, Pressable, StyleSheet } from 'react-native';
import {
  MD3LightTheme as DefaultTheme,
  PaperProvider, Button, Card
} from 'react-native-paper';
import { FlatList } from 'react-native-web';

const App = () => {

  const list = [
    {
      'mark': 'TOYOTA',
      'model': "RAV4"
    },
    {
      'mark': 'BMW',
      'model': "E34"
    },
    {
      'mark': 'ZEEKR',
      'model': "001"
    },
    {
      'mark': 'Nissan',
      'model': "Qashqai"
    },
  ]

  const renderer = ({ item }) => {
    return (
    <Card>
      <Card.Title> title={item.model}</Card.Title>
      <Card.Content>
        <Text></Text>
      </Card.Content>
    </Card>
    )

  }

  return (
    <PaperProvider theme={DefaultTheme}>
      <View style={{ flex: 1, fontSize: '30px', alignItems: 'center', justifyContent: 'center' }}>
        <FlatList
          data={list}
          renderItem={renderer}
        >
        </FlatList>
      </View>
    </PaperProvider>
  );
}

export default App;
